"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Preparing for pregnancy when you have diabetes (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/preparing-for-pregnancy-when-you-have-diabetes-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H92847365\">",
"      <span class=\"h1\">",
"       How should I prepare for pregnancy if I have diabetes?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you want to get pregnant, it is very important that you talk to your doctors",
"      <strong>",
"       before",
"      </strong>",
"      you start trying to get pregnant. You will need to see an obstetrician (a doctor who takes care of pregnant women) and your primary care doctor. If you see an endocrinologist (a doctor who handles your diabetes), you should mention your pregnancy plans to him or her, too. These doctors can make sure that you do everything possible to have a healthy baby.",
"     </p>",
"     <p>",
"      Before you start trying to get pregnant, you will need to work closely with your healthcare team to get your blood sugar as close to normal as possible. That might mean using more insulin, if you already use it. Or switching to insulin, if you do not already use it. Plus, you might need to change the way you eat and increase your activity levels. &nbsp;",
"     </p>",
"     <p>",
"      Normal blood sugar levels help prevent miscarriages and birth defects.",
"     </p>",
"     <p>",
"      You should also talk to your doctors about",
"      <strong>",
"       all",
"      </strong>",
"      medicines you take&mdash;including any supplements or herbal medicines. If you use any medicines that are not safe to take during pregnancy, you might need to switch or go off them.",
"     </p>",
"     <p>",
"      This article discusses the things women with diabetes should do before getting pregnant. There are also steps that",
"      <strong>",
"       all",
"      </strong>",
"      women should take before trying to get pregnant. (See",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?37/1/37907?source=see_link\">",
"       \"Patient information: How to plan and prepare for a healthy pregnancy (The Basics)\"",
"      </a>",
"      .)",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H92847372\">",
"      <span class=\"h1\">",
"       Which medicines should I stop taking before I try to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You should stop taking:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Certain medicines used to treat high blood pressure. It is especially important to stop medicines called ACE inhibitors and angiotensin receptor blockers (sometimes called ARBs). These medicines can cause birth defects.",
"        <br/>",
"        <br/>",
"        But don&rsquo;t stop your high blood pressure medicine on your own. High blood pressure can be harmful. Your doctor will switch you to a blood pressure medicine that is safe to take during pregnancy.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Medicines called statins, which are used to lower cholesterol. These medicines have not been well studied in pregnant women. But doctors recommend stopping them, because there is a chance they could affect a baby&rsquo;s development.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Remember, by the time a woman discovers she is pregnant, her baby has already started to form many important body parts. That&rsquo;s why it is not enough to stop taking medicines that might be harmful when you learn you are pregnant. &nbsp;",
"     </p>",
"     <p>",
"      If you get pregnant while taking any medicines, tell your doctors right away. They can explain any possible risks to your baby and help you decide how best to move forward. &nbsp;",
"     </p>",
"     <p>",
"      Before you start trying to get pregnant, your doctors will probably also want you to stop taking diabetes medicines that come in pill form, such as",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?15/38/15973?source=see_link\">",
"       glyburide",
"      </a>",
"      and",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?0/22/358?source=see_link\">",
"       metformin",
"      </a>",
"      . They will want you to use insulin instead.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H92847379\">",
"      <span class=\"h1\">",
"       Will I need any tests before I start trying to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. You will need these tests:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        <strong>",
"         An eye exam",
"        </strong>",
"        (if you have not had one in the last 12 months) &mdash; You will need to be checked for an eye disease called &ldquo;diabetic retinopathy.&rdquo; This condition is caused by diabetes, and it can lead to vision loss or even blindness. Pregnancy can increase the chance that a woman will get diabetic retinopathy, and it can make the condition worse in women who already have it. If you have severe diabetic retinopathy, you might need to treat the condition before you get pregnant.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        <strong>",
"         Blood and urine tests to check the health of your kidneys",
"        </strong>",
"        &mdash; People with diabetes are at risk for kidney disease. Pregnancy can worsen kidney disease that already exists. &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        <strong>",
"         Blood pressure test",
"        </strong>",
"        &mdash; Having high blood pressure during pregnancy can cause problems for you and your baby. If your blood pressure is too high, your doctors might give you medicines to treat it. But they will choose medicines that are safe to use during pregnancy. Some of the medicines normally used to treat high blood pressure are not safe to use during pregnancy.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        <strong>",
"         Blood tests to measure thyroid hormone levels",
"        </strong>",
"        &mdash; Having normal thyroid hormone levels is very important for a developing baby. If your tests show that your thyroid hormone levels are too high or too low, you might need treatments to get them back to normal.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        <strong>",
"         Urine tests to check for infection",
"        </strong>",
"        &mdash; Women with diabetes can have bladder or kidney infections and not know it. It&rsquo;s important to treat these before pregnancy. &nbsp;",
"        <strong>",
"        </strong>",
"       </li>",
"      </ul>",
"     </p>",
