var title_f14_47_15100="Cataract classification";
var content_f14_47_15100=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F81218&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F81218&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Classification of cataracts in children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Category",
"       </td>",
"       <td class=\"subtitle1\">",
"        Location",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comment",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Anterior polar",
"       </td>",
"       <td>",
"        Anterior poles; usually bilateral",
"       </td>",
"       <td>",
"        Often hereditary",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Persistent fetal vasculature",
"       </td>",
"       <td>",
"        Posterior; unilateral",
"       </td>",
"       <td>",
"        Associated with microphthalmia and glaucoma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        Posterior polar",
"       </td>",
"       <td>",
"        Unilateral posterior pole (Mittendorf dot)",
"       </td>",
"       <td>",
"        &nbsp;",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Bilateral posterior pole",
"       </td>",
"       <td>",
"        May be associated with defects in the posterior capsule",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Posterior lentiglobus/lenticonus",
"       </td>",
"       <td>",
"        Posterior capsule; mainly unilateral",
"       </td>",
"       <td>",
"        Usually sporadic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Posterior subcapsular",
"       </td>",
"       <td>",
"        Immediately anterior to posterior capsule",
"       </td>",
"       <td>",
"        Associated with inflammatory conditions, glucocorticoids use, ionizing radiation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Total (diffuse, complete)",
"       </td>",
"       <td>",
"        Involve entire crystalline lens",
"       </td>",
"       <td>",
"        Usually seen after trauma",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"3\">",
"        Zonular cataracts",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Lamellar",
"       </td>",
"       <td class=\"sublist_other\">",
"        Layer of cortex peripheral to the Y sutures of the lens; usually bilateral",
"       </td>",
"       <td class=\"sublist_other\">",
"        May be hereditary (autosomal dominant) or acquired",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Nuclear",
"       </td>",
"       <td class=\"sublist_other\">",
"        Embryonal or fetal nucleus; unilateral or blateral",
"       </td>",
"       <td class=\"sublist_other\">",
"        Microphthalmia and microcornia are usually present",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        Sutural",
"       </td>",
"       <td class=\"sublist_other\">",
"        Y sutures",
"       </td>",
"       <td class=\"sublist_other\">",
"        &nbsp;",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
